import React from 'react';
import './App.css';
import { Outlet } from 'react-router-dom';
import { Card, CardImg, CardBody, CardTitle, CardSubtitle } from 'reactstrap';

const styles = {
  card: {
    backgroundColor: '#327CA',
    borderRadius: 55,
    padding: '3rem',
  },
  cardImage: {
    objectFit: 'cover',
    borderRadius: 55,
    width: '50vw',
    height: '30vh',
  },
};

function Home() {
  return (
    <div className="div">
      <Outlet />
      <Card m-5 border-0 shadow style={styles.card}>
        <CardBody className="position-relative">
          <CardTitle className="h3 mb-2 pt-2 font-weight-bold text-primary text-dark">
            Welcome to Joel Hilton's Movie Collection
          </CardTitle>
          <CardSubtitle
            className="text-secondary mb-3 font-weight-light text-uppercase"
            style={{ fontSize: '0.8rem' }}
          >
            Here you will find the best movies
          </CardSubtitle>

          <div>
            <CardImg
              src="./joel.jpg"
              alt="Joel"
              className="position-relative img-fluid size"
            ></CardImg>
          </div>
        </CardBody>
      </Card>
    </div>
  );
}

export default Home;
